export function CheckAuth(name, password, setNameError, setServerError) {
  axios({
    method: 'POST',
    baseURL: API + 'signin',
    data: {
      name: name,
      password: password
    }
  }).then((data) => {
    if (data.status === 203) {
      setNameError(true);
    } else {
      setAuth(data.headers.authorization);
      this.props.logIn(data.headers.authorization, this.state.name, data.data);
    }
  }).catch((err) => {
    this.setState({
      serverError: true,
    })
  });
}

